import React from "react";
import Footer from "../../components/footer/Footer";
import Header from "../../components/header/Header";
import MailList from "../../components/maiList/MailList";
import Navbar from "../../components/navbar/Navbar";
import "./Support.css"

const Support = () => {
  return (
    <div >
      <Navbar />
      <Header type="List" />
      <div className="popular" id="support">
        <div
          className="fpItem"
          onClick={() => {
            window.location.href = "https://stpetersmodelschool.co.in/";
          }}
        >
          <img
            id="image"
            alt=""
            src="data:image/jpeg;base64,"
            className="popularImg"
          />
          <span className="popularName">ST.Peters Model School</span>
          <span className="popularCity">Hyderabad</span>
          <div className="popularRating">
            <button>9.0</button>
            <span>Excellent</span>
          </div>
        </div>
        <div
          className="fpItem"
          onClick={() => {
            window.location.href = "http://localhost:3000/school/1";
          }}
        >
          <img
            id="image"
            alt=""
            src="data:image/jpeg;base64,"
            className="popularImg"
          />
          <span className="popularName">
            Nalla Malla Reddy Engineering College
          </span>
          <span className="popularCity">Hyderabad</span>
          <div className="popularRating">
            <button>7.0</button>
            <span>Good</span>
          </div>
        </div>
        <div className="fpItem" onClick={() => {}}>
          <img
            id="image"
            alt=""
            src="./images/giri.jpg"
            className="popularImg"
          />
          <span className="popularName">Delhi Public School</span>
          <span className="popularCity">Hyderabad</span>
          <div className="popularRating">
            <button>9.0</button>
            <span>Excellent</span>
          </div>
        </div>
      </div>

      <MailList />
    </div>
  );
};

export default Support;
